import React from 'react';
import Contents from '../layout/Contents';
import Footer from '../layout/Footer';
import ReviewCont from '../includes/ReviewCont';

function Review() {
  return (
    <>
        <Contents>
          <ReviewCont/>
        </Contents>
        <Footer/>
    </>
  );
}

export default Review;
